                        <Button color="secondary" component={Link} to="/contact">Contact</Button>
                    </Grid>
                    <Grid item xs={12} sm={4}>
                        <Button color="secondary" component={Link} to="/termCondition">Terms &amp; Conditions</Button>
                    </Grid>
